import axios from 'axios';

export default fetchData = async () => {
    const res = await axios().get('https://api.weebly.com/v1/user/sites/987654321/store/categories')
    const categories = res.json()

    console.log(categories)
    return {
        props: {
            categories,
        },
    }
}
